import React from "react";

export default class Lib{
    public Comp :JSX.Element;
    public Alternative :JSX.Element;


    public Premission():boolean{
        return true;
    }

    public GetComp(){
        if(this.Premission())
            return this.Comp;
        else 
            return this.Alternative
    }

    constructor(Comp:()=>JSX.Element , Alternative?:JSX.Element){
        if(Alternative)
            this.Alternative = Alternative;
        else
            this.Alternative = this.AlternativeConponent();
        this.Comp = Comp();
    }


    public AlternativeConponent = ()=>{
        return React.createElement("div");
    }
}
